// components
import FunctionUI from '../components/FunctionUI';
import Nav from './../components/Nav';
import About from './../components/About';
import List from './../components/List'

const Portfolio = ({ }) => {

    const [display, setDisplay] = useState(false);
    const [active, setActive] = useState(false);
    const data = "english"

    if (display) {
        return (
                <FunctionUI
                    leng={data}
                    setDisplay={setDisplay}
                    display={display}
                />
        )
    } else {
        return <>
            <Nav
                active={active}
                setActive={setActive}
                setDisplay={setDisplay}
            />
            {active ? <List
                leng={data}
                setActive={setActive}
            /> :
               <> 
               <About leng={data} />
               <div
               style = {{
                   backgroundImage: `url("https://photos.google.com/photo/AF1QipMJbojUhVFj0QVTqpCXuWz7uK_Pwnj-DNMTR4eW")`,
                   height: "200px",
                   wid
               }}
               ></div>
               </>}
        </>
    }
}

export default Portfolio;
